        alert("fljfn")
    )
   }


return (
    <div className="book">
        <img src={props.img} class="img-fluid" alt="..." />
        <div className="title">
        <h1>{props.show.name}</h1>
        </div>
        <div className="rating">
            <h6>Rating <br /> {props.show.rating.average}</h6>
        </div>
        
        <article>
            {props.show.summary}
        </article>
        <div className="btnn">
        <button type="button" class="btn btn-secondary btn-lg btn-block" onClick={Ticket}>Book Now</button>
        </div>
    </div>
    
)
};
export default Book;
